import React from 'react';
import { Link } from 'react-router-dom';
import '../contact.css';


function HeroSection() {
  React.useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <div className='hero-container'>

        <h1>Contact</h1>

    </div>
  );
}

export default HeroSection;
